The most popular compiler optimization is probably peephole optimization . It is a set of optimizations that are applied to a very small subset of the code, typically just a few instructions at a time. The optimizations are applied to a small window that is slid over the code, instruction by instruction, and that is the source of the name.
Peephole optimizations are simple to implement and can be very effective. They are also easy to understand. For example, the following instruction sequence:
ADD 1,REGA
SUB 1,REGA
can be eliminated entirely, because the two instructions cancel each other out.

